import Banner from "../../components/Banner";
import ContainerHome from "../../components/ContainerHome";
import Footer from "../../components/Footer";
import Header from "../../components/Header";
import '@fontsource/montserrat/300.css';

function Home() {
  return (      
      <>
      <Header>
      <a href="cadastro.html" className={styles.cadastrese}>Cadastre-se</a>
        <a href="login.html" className={styles.navlinksl}>Login</a>
        <a href="#" className={styles.navlinks}>Sobre nós</a>
      </Header>
      <ContainerHome>
      <Banner />
      </ContainerHome>
      <Footer />
      </>
  );
}

export default Home;
